import React from 'react'

export const Todos = ({todos}) => {
  return (
    <div>
      <h1>Todos</h1>
      <p>{todos.map((todo) => {
        return (
          <div>
            <p>{todo}</p>
          </div>
        )
      })}</p>
    </div>
  )
}
